import React, { Component } from 'react'

// Components
import FullScreen from '../fullscreen'
import Topic from '../topic'

class Project extends Component {
  render() {
    return (
      <FullScreen>
        <Topic>Projects</Topic>
      </FullScreen>
    )
  }
}

export default Project
